ATION_IN_HOURS hours or after you reset your password.<br/><br/>In the event that you didn\'t make this request, then you may disregard this message. Your existing password is still safe and you can delete this email. Should you have any additional questions, please contact Unity Technical Support.<br/><br/>Thank you for using Unity.<br/><br/>Sincerely,<br/><br/>The Unity Services Team.',''),(4,NULL,'2017-08-14 12:54:33','n/a',NULL,'Reset Account!',NULL,NULL,'2017-08-14 12:54:33','n/a',0,'Hello $MSG_FIRST_NAME,<br/><br/>You have received this e-mail because you can’t access to your account at Unity Platform.<br/><br/>Please click on the link below to create a new password<br/><a href=\"$MSG_ACTIVATION_URL\">$MSG_ACTIVATION_URL</a><br/><br/>If this link does not work, please copy and paste it into your browser\'s address window.<br/>For security purposes, this link will expire in 48 hours or after you activate your account.<br/><br/>If you have not experienced problem with access to your account at Unity Platform and received this e-mail, please contact your Administrator or Unity Technical Support.<br/><br/>Should you have any additional questions, please contact Unity Technical Support.<br/>Thank you for using Unity.<br/><br/>Sincerely,<br/><br/>The Unity Services Team.','');
